import React from 'react'

//Author Panagiotis Oikonomou

const Home = () => {
  return (
    <div>
        <h2>Hello my page</h2>
        <label>
          <p>
          WebHR is great. WebHR is easy to use, has good customer support and they are very responsive to our needs. \n 
          They even have been very flexible with making custom program changes.
          </p>
        </label>
        
    </div>
  )
}

export default Home
